class Solution(object):

    def binary_search(self, a, x, lo=0, hi=None):
        if hi is None:
            hi = len(a)
        while lo < hi:
            mid = (lo+hi)//2
            midval = a[mid]
            if midval < x:
                lo = mid+1
            elif midval > x:
                hi = mid
            else:
                return mid
        return -1

    def twoSum(self, numbers, target):
        """
        :type numbers: List[int]
        :type target: int
        :rtype: List[int]
        """
        i = 0
        s = []
        result = []
        while (i < len(numbers) - 1):
            s.append(target - numbers[i])
            i += 1

        k = 0
        while(k < i and len(result) < 2):
            index1 = self.binary_search(numbers, s[k])

            # print(s[k], k, index1, s)

            if index1 != -1:
                result.append(k + 1)
                # index2 = self.binary_search(s, target - numbers[k])
                result.append(index1 + 1)

            k += 1
        return result

